INSERT INTO `messages` (`mes_id`, `mes_header`, `mes_text`) VALUES
(1, 'Вітаємо Вас у приймальній комісії!!! 2015року', 'З ПОЧАТКОМ ВАС, ШАНОВНІ КОЛЕГИ'),
(2, '', 'Провадження освітньої діяльності у Житомирському державному університеті імені Івана Франка здійснюється відповідно до ліцензії Міністерства освіти і науки, молоді та спорту серія АГ № 582015, дата отримання 14.09.2011, термін дії ліцензії до 01.07.2014). Правила прийому розроблені Приймальною комісією Житомирського державного університету імені Івана Франка (далі – приймальна комісія) відповідно до Умов прийому до вищих навчальних закладів України в 2012 році, затверджених наказом Міністерства освіти і науки, молоді та спорту України від 12 жовтня 2011 року № 1179 та зареєстрованих у Міністерстві юстиції України 20 жовтня 2011 року за № 1221/19959, 1222/19960. ');
